import React from 'react'
import CAR from "../images/car.jpg"

const Car = () => {
  return (
    <div id='car'>
      <img src={CAR} alt='car' className='car'/>
      <div class="sketchfab-embed-wrapper"> <iframe title="F1 Ferrari SF-24" frameborder="0" allowfullscreen mozallowfullscreen="true" webkitallowfullscreen="true" allow="autoplay; fullscreen; xr-spatial-tracking" xr-spatial-tracking execution-while-out-of-viewport execution-while-not-rendered web-share src="https://sketchfab.com/models/eccf78a17c0548a7bc44e1f2ea227a99/embed"> </iframe> <p style="font-size: 13px; font-weight: normal; margin: 5px; color: #4A4A4A;"> <a href="https://sketchfab.com/3d-models/f1-ferrari-sf-24-eccf78a17c0548a7bc44e1f2ea227a99?utm_medium=embed&utm_campaign=share-popup&utm_content=eccf78a17c0548a7bc44e1f2ea227a99" target="_blank" rel="nofollow" style="font-weight: bold; color: #1CAAD9;"> F1 Ferrari SF-24 </a> by <a href="https://sketchfab.com/P212?utm_medium=embed&utm_campaign=share-popup&utm_content=eccf78a17c0548a7bc44e1f2ea227a99" target="_blank" rel="nofollow" style="font-weight: bold; color: #1CAAD9;"> Project 212 </a> on <a href="https://sketchfab.com?utm_medium=embed&utm_campaign=share-popup&utm_content=eccf78a17c0548a7bc44e1f2ea227a99" target="_blank" rel="nofollow" style="font-weight: bold; color: #1CAAD9;">Sketchfab</a></p></div>

    </div>

  )
}

export default Car
